import React from "react";
import clickerGamepadImage from "./images/gamepad.png";
import "./styles/ClickerGamepad.css";
export default function ClickerGamepad(props){
    return (
        <div className="ClickerGamepad">
            <button className="ClickerGamepadButton" datatype="square" onClick={props.onClick} >
                <img className="ClickerGamepadImage" src={clickerGamepadImage}/>
            </button>
        </div>
    );
};
